def decrypt(data, r=55665, n=4)
  c1 = 52845
  c2 = 22719

  data.bytes.map do |byte|
    t = (r >> 8)
    plain_text_byte = (byte ^ t) & 0xFF
    r = ((byte + r) * c1 + c2) & 0xFFFF
    plain_text_byte
  end[4..-1].pack("C*")
end

