def decode_character_data(data)
  decoded_data = []
  data = StringIO.new(data)

  until data.eof?
    case v = data.getbyte
    when 32..246
      decoded_data << v - 139

    when 247..250
      w = data.getbyte

      decoded_data << ((v - 247) * 256) + w + 108

    when 251..254
      w = data.getbyte

      decoded_data << -((v - 251) * 256) - w - 108

    when 255
      raise "er..."

    when 0..31
      command = $charstring_command_map.fetch v, "UNKOWN: #{v}"
      if command == :escape
        v = data.getbyte

        command = $charstring_escape_command_map.fetch v, "UNKNOWN_ESCAPE: #{v}"
      end

      decoded_data << command

    else
      puts "skipping: #{v.inspect}"
    end
  end

  decoded_data
rescue
  puts "DATA: #{decoded_data.inspect}"
  raise
end

